Приложение Yapona Mama– это самый удобный и быстрый способ заказать вкуснейшие суши! Устанавливайте приложение Yapona Mama и получайте онлайн-доступ к нашему сервису доставки в любое время и в любом месте. 

Заказывайте доставку суши, пиццы на дом или берите с собой, посетив наши заведения. Просматривайте подробное меню с описаниями ингредиентов каждого блюда и прекрасными фото, читайте страницы Yapona Mama в социальных сетях и делитесь ими с друзьями.

Используя наше приложение, Вы можете:
- самостоятельно сформировать и оплатить заказ;
- выбрать удобный для Вас способ оплаты;
- установить время, в которое Вы бы хотели забрать заказ из нашего заведения; 
- установить время доставки заказа на дом;

Используя мобильное приложение Yapona Mama, Вы с легкостью можете заказать суши, пиццу, wok, салаты на любой вкус.  Доступные в приложении подробные описания и качественные фотографии блюд помогут Вам выбрать именно то, что Вы хотите.

Что получится, если связать воедино лаконичную японскую эстетику, вкусные суши и функциональность?

Теперь YaponaMama еще ближе к вам! Закажите суши, роллы и другие полюбившиеся вам блюда всего за несколько кликов!

- подробное меню с фотографиями и описанием блюд;
- отслеживание статуса;
- online-оплата через Uzcard;
- оплата наличными и банковской картой при доставке и самовывозе;
- выбор блюд по ингредиентам;
- быстрый поиск по блюдам в пределах категории;
- прямой вызов в call-центр одним кликом;
- можно указать адрес с помощью геолокации;
- персональный кабинет, где можно просматривать историю заказов и вносить адреса;
- синхронизация заказов между различными устройствами.

Новое мобильное приложение «Шоколадницы» — это единая программа лояльности для всех заведений сети. С его помощью вы сможете без труда найти ближайшее кафе, узнать о действующих акциях и специальных предложениях.

Что дает участие в программе лояльности:

- бонусы за каждый заказ, которыми можно оплачивать следующие покупки (до 50% от суммы чека);
- кэшбек 10%;
- кофе (размера S) в подарок после первой покупки;
- 200 бонусов в подарок за 5 дней до дня рождения;
- «штампики»: каждый 10-й кофе, завтрак, ланч и ужин — бесплатно;
- персональные акции: пуш-уведомления с выгодными предложениями;
- абонементы и подарочные карты, которые можно приобрести в приложении и подарить в электронном виде.

Приложение Красное&Белое — одна маленькая иконка, а столько полезных функций! Регистрируйся в удобном личном кабинете и ты сможешь:

• Узнать стоимость любого товара;
• Узнать об акциях и скидках;
• Определить местонахождение ближайшего магазина;
• Найти нужный товар, ознакомиться с его описанием и рейтингом;
• Проверить напитки на легальность по коду в чеке;
• Привязать дисконтную карту к смартфону и получать скидку;

Мобильное приложение Красное&Белое носит информационный характер. Предназначено только для предоставления сведений о наличии товаров в магазинах и их бронировании, не предусматривает возможности покупки и доставки товаров. Предназначено для лиц, достигших 18-летнего возраста.

Добро пожаловать! У нас собраны самые интересные блюда мира. Возможности приложения:

+ Более 6000 рецептов;
+ Все рецепты абсолютно бесплатные;
+ Приложение работает без подключения к интернету;
+ База рецептов регулярно пополняется новыми рецептами;
+ Все рецепты с фотографиями;
+ Много рецептов с пошаговыми фотографиями;
+ Более 100 категорий рецептов;
+ Поиск по названию, ингредиентам и категории;
+ Избранное;
+ Список покупок;
+ Сортировка и фильтр;
+ Личные заметки к рецептам;
+ Возможность комментировать, оценивать рецепты, а также добавлять свои фотографии в комментарии;
+ Рейтинг лучших рецептов за день, неделю, месяц;
+ Интересные статьи и полезные советы;
+ Возможность отключить рекламу.

Мы готовы выслушать любые ваши идеи и пожелания относительно дальнейшего развития приложения. 

Все кулинарные рецепты собираются из открытых источников.

Приятного аппетита!

